import React from 'react';
import { Box, Grid2, Typography, TextField, Button } from '@mui/material';
import { Link } from 'react-router-dom';

const Login = () => {
  return (
    <Box
      sx={{
        height: '100vh',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        backgroundColor: '#f0f0f0',
      }}
    >
      <Grid2 container sx={{ maxWidth: '600px', boxShadow: 3, borderRadius: '12px', overflow: 'hidden' }}>
        {/* Left Side - Create Account Option */}
        <Grid2
          item
          xs={12}
          sm={5}
          sx={{
            backgroundColor: '#26a69a',
            color: '#fff',
            padding: '2rem',
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            justifyContent: 'center',
          }}
        >
          <Typography variant="h4" gutterBottom>
            Hello, Friend!
          </Typography>
          <Typography variant="body1" sx={{ marginBottom: '2rem', textAlign: 'center' }}>
            Don't have an account yet? Click below to sign up.
          </Typography>
          <Link to="/register">
            <Button
              variant="contained"
              sx={{
                backgroundColor: '#fff',
                color: '#26a69a',
                '&:hover': {
                  backgroundColor: '#e0e0e0',
                },
              }}
            >
              Sign Up
            </Button>
          </Link>
        </Grid2>

        {/* Right Side - Login Form */}
        <Grid2
          item
          xs={12}
          sm={7}
          sx={{
            backgroundColor: '#fff',
            padding: '2rem',
            position: 'relative',
          }}
        >
          <Typography variant="h4" sx={{ marginBottom: '1rem' }}>
            Sign In
          </Typography>

          <Box component="form" sx={{ display: 'flex', flexDirection: 'column', gap: '1rem' }}>
            <TextField label="Email" variant="outlined" fullWidth />
            <TextField label="Password" variant="outlined" fullWidth type="password" />

            <Button variant="contained" color="primary" sx={{ marginTop: '1rem' }}>
              Login
            </Button>
          </Box>
        </Grid2>
      </Grid2>
    </Box>
  );
};

export default Login;
